#include <bits/stdc++.h>
using namespace std;

using ll = long long;
#define endl '\n'
const int N = 1e2 + 10;
const int INF = 0x3f3f3f3f;

class Dinic {
private:
	struct Edge {
		int from, to, cap, flow;
		Edge (int u, int v, int c, int f) :
		from(u), to(v), cap(c), flow(f){}
	};
	vector<Edge> edges;
	vector<int> g[N];
	int dep[N], cur[N];
	int n;
public:
	void init (int _n) {
		n = _n;
		for (int i = 0; i <= n; i ++) {
			g[i].clear();
		}
		edges.clear();
	}
	void addEdge (int u, int v, int c) {
		edges.push_back({u, v, c, 0});
		edges.push_back({v, u, 0, 0});
		int m = edges.size();
		g[u].push_back(m - 2);
		g[v].push_back(m - 1);
	}
	int bfs (int s, int t) {
		queue<int> q;
		memset(dep, 0, sizeof dep);
		dep[s] = 1;
		q.push(s);
		while (!q.empty()) {
			int x = q.front();
			q.pop();
			for (auto &i: g[x]) {
				Edge &e = edges[i];
				if (!dep[e.to] && e.cap > e.flow) {
					dep[e.to] = dep[x] + 1;
					q.push(e.to);
				}
			}
		}
		return dep[t];
	}
	int dfs (int x, int t, int flow) {
		if (x == t || flow == 0) return flow;
		int res = 0;
		for (int i = cur[x]; i < (int)g[x].size(); i ++) {
			cur[x] = i;
			Edge &e = edges[g[x][i]];
			int y = e.to;
			if (dep[y] == dep[x] + 1) {
				int d = dfs(e.to, t, min(flow - res, e.cap - e.flow));
				res += d;
				edges[g[x][i]].flow += d;
				edges[g[x][i] ^ 1].flow -= d;
				if (res == flow) return res;
			}
		}
		return res;
	}
	int dinic (int s,int t) {
		int maxflow = 0;
		while (bfs(s, t)) {
			memset(cur, 0, sizeof(int) * (n + 1));
			maxflow += dfs(s, t, INF);
		}
		return maxflow;
	}
	void print (int s, int t, int m) {
		queue<int> q;
		vector<bool> vis(n + 1, 0);
		q.push(s);
		vector<int> res;
		while (!q.empty()) {
			int x = q.front();
			q.pop();
			if (vis[x]) continue;
			vis[x] = 1;
			res.push_back(x);
			for (auto &i: g[x]) {
				Edge &e = edges[i];
				if (e.cap > e.flow) q.push(e.to);
			}
		}
		sort(res.begin(), res.end());
		bool f = 0;
		for (auto x: res) {
			if (x == s || x == t) continue;
			if (x > m) {
				if (!f) {
					cout << endl;
					f = 1;
				}
				cout << x - m << ' ';
			}
			else cout << x << ' ';
		}
		cout << endl;
	}
};
Dinic dinic;

vector<int> read () {
	char tools[10000];
	memset(tools,0,sizeof tools);
	cin.getline(tools,10000);
	int ulen=0,tool;
	vector<int> res;
	while (sscanf(tools+ulen,"%d",&tool)==1)//之前已经用scanf读完了赞助商同意支付该实验的费用
	{//tool是该实验所需仪器的其中一个      
		//这一行，你可以将读进来的编号进行储存、处理，如连边。
		res.push_back(tool);
		if (tool==0) 
			ulen++;
		else {
			while (tool) {
				tool/=10;
				ulen++;
			}
		}
		ulen++;
	}
	return res;
}

int n, m;
int p[N];

void solve() {
	cin >> m >> n;
	int s = 0, t = n + m + 1;
	dinic.init(t);
	int sum = 0;
	for (int i = 1; i <= m; i ++) {
		cin >> p[i];
		sum += p[i];
		dinic.addEdge(s, i, p[i]);
		auto res = read();
		for (auto x: res) {
			dinic.addEdge(i, x + m, INF);
		}
	}
	for (int i = 1; i <= n; i ++) {
		int cost;
		cin >> cost;
		dinic.addEdge(i + m, t, cost);
	}
	int ans = sum - dinic.dinic(s, t);
	dinic.print(s, t, m);
	cout << ans;
}

signed main() {
	ios::sync_with_stdio(false);
	cin.tie(0), cout.tie(0);
	int _ = 1;
//	cin >> _;
	while (_--){
		solve();
	}
	return 0;
}

#include <bits/stdc++.h>
using namespace std;

using ll = long long;
#define endl '\n'
const int N = 1e2 + 10;
const int INF = 0x3f3f3f3f;

class Dinic {
private:
	struct Edge {
		int v, nxt, cap, flow;
	} e[N * N];
	int fir[N], cnt = 0;
	int dep[N], cur[N];
	ll maxflow = 0;
	int S, T;
public:
	void init (int s, int t) {
		S = s;
		T = t;
		memset(fir, -1, sizeof fir);
		cnt = 0;
	}
	void addEdge (int u, int v, int c) {
		e[cnt] = {v, fir[u], c, 0};
		fir[u] = cnt ++;
		e[cnt] = {u, fir[v], 0, 0};
		fir[v] = cnt ++;
	}
	int bfs () {
		queue<int> q;
		memset(dep, 0, sizeof dep);
		dep[S] = 1;
		q.push(S);
		while (!q.empty()) {
			int x = q.front();
			q.pop();
			for (int i = fir[x]; ~i; i = e[i].nxt) {
				int y = e[i].v;
				if (!dep[y] && e[i].cap > e[i].flow) {
					dep[y] = dep[x] + 1;
					q.push(y);
				}
			}
		}
		return dep[T];
	}
	int dfs (int x, int flow) {
		if (x == T || flow == 0) return flow;
		int res = 0;
		for (int i = cur[x]; ~i; i = e[i].nxt) {
			int y = e[i].v;
			if (dep[y] == dep[x] + 1) {
				int d = dfs(y, min(flow - res, e[i].cap - e[i].flow));
				res += d;
				e[i].flow += d;
				e[i ^ 1].flow -= d;
				if (res == flow) return res;
			}
		}
		return res;
	}
	int dinic () {
		while (bfs()) {
			memcpy(cur, fir, sizeof cur);
			maxflow += dfs(S, INF);
		}
		return maxflow;
	}
	void print() {
		for (int x = 1; x < S; x ++) {
			for (int i = cur[x]; ~i; i = e[i].nxt) {
				int y = e[i].v;
				if(y < S && e[i].flow > 0) {
					cout << x << ' ' << y << endl;
				}
			}
		}
	}
};
Dinic dinic;

int n, m;

void solve() {
	cin >> m >> n;
	int s = n + 1, t = n + 2;
	dinic.init(n + 1, n + 2);
	for (int i = 1; i <= n; i ++) {
		if (i <= m) dinic.addEdge(s, i, 1);
		else dinic.addEdge(i, t, 1);
	}
	while (1) {
		int u, v;
		cin >> u >> v;
		if (u == - 1 && v == -1) break;
		dinic.addEdge(u, v, 1);
	}
	cout << dinic.dinic() << endl;
	dinic.print();
}

signed main() {
	ios::sync_with_stdio(false);
	cin.tie(0), cout.tie(0);
	int _ = 1;
//	cin >> _;
	while (_--){
		solve();
	}
	return 0;
}
